import React, { useState } from "react";
import "./index.css";

const InputField = ({ subject }) => {
  const [isValid, setIsValid] = useState(true);

  return (
    <>
      <a>{subject}</a>
      <input className={isValid ? "valid" : "invalid"}></input>
    </>
  );
};

export default InputField;
